//pages/newcollection.js

import Layout from '../components/MyLayout';

export default function NewCollection() {
  return (
    <Layout>
        <h1>Define a New Collection of Asset</h1> 
        <br /><hr /><br />
        <form>
            <h1>Collection</h1>
            <p>Name:</p>
            <input
            type="text"
            />
            <p>Symbol:</p>
            <input
            type="text"
            />
      </form>
    </Layout>
  );
}
